    $(function() {
    	CreativeTemplate.Init();
    });

    var CreativeTemplate = {
    	// PROPERTIES
        "KeyCodes": { "tab": 9, "enter": 13, "esc": 27, "space": 32, "end": 35, "home": 36, "left": 37, "up": 38, "right": 39, "down": 40 },
        "IsMyViewPage": false, // UPDATES IN SetTemplateProps METHOD

        // METHODS
        "Init": function() {
            // FOR SCOPE
            var _this = this;

            this.SetTemplateProps();
            this.DynamicStyles();
            this.JsMediaQueries();
            this.Header();
            this.MyStart();            
            this.ChannelBar();
            this.Body();
            this.UpcomingEvents();
            this.Footer();
            this.Slideshow();
            this.RsMenu();
            this.Search();

            csGlobalJs.OpenInNewWindowWarning();

            $(window).load(function(){ _this.WindowLoad(); });
            $(window).resize(function(){ _this.WindowResize(); });
            $(window).scroll(function(){ _this.StickyHeader(); });
        },

        "SetTemplateProps": function() {
        	// MYVIEW PAGE CHECK
            if($("#pw-body").length) this.IsMyViewPage = true;
        },

        "WindowLoad": function() {
 			$("div.ui-widget.app.navigation li .bullet").each(function() {
            	$(this).insertAfter($(this).siblings("a"));
            });
        },

        "WindowResize": function() {
            this.JsMediaQueries();
        },

        "StickyHeader": function() {
			if(!this.IsMyViewPage) {
                switch(this.GetBreakPoint()) {
                    case "desktop":
                        var navOffSet = $("header").outerHeight();
                        if ($(window).scrollTop() <= navOffSet) {
                            if(this.HeaderIsSticky) {
                                $("header").removeClass("fixed-element").removeAttr("style");
                                $("#gb-page").css("padding-top", 0);

                                this.HeaderIsSticky = false;
                            }

                            if($(".sp").length && $(".ui-widget.app.calendar").length) {
                                $(".wcm-controls").css("margin-top", "0px");
                            }
                        } else {
                            $("header").css("height", $("#gb-header-outer").outerHeight(true)+ $("#gb-mystart-outer").outerHeight(true));
                            $("#gb-page").css("padding-top", $("header").outerHeight(true));

                            if(!this.HeaderIsSticky) {
                                $("header").addClass("fixed-element");

                                this.HeaderIsSticky = true;
                            }

                            if($(".sp").length && $(".ui-widget.app.calendar").length) {
                            	if($(".wcm-controls").hasClass("wcm-stuck")) {
                                	$(".wcm-controls").css("margin-top", $("header").outerHeight(true));
                                }
                            }
                        }

                        $("#sw-maincontent").css({
                            "display": "block",
                            "position": "relative",
                            "top": "-" + $("nav").outerHeight(true) + "px"
                        });
                    break;
                    case "768": case "640": case "480": case "320":
                        if(this.HeaderIsSticky) {
                            $("header").removeClass("fixed-element").removeAttr("style");
                            $("#gb-page").css("padding-top", 0);

                            this.HeaderIsSticky = false;
                        }

                        if($(".sp").length && $(".ui-widget.app.calendar").length) {
                            $(".wcm-controls").css("margin-top", "0px");
                        }
                        $("#sw-maincontent").removeAttr("style");
                    break;
                }
            }
        },

        "JsMediaQueries": function() {
            switch(this.GetBreakPoint()) {
                case "desktop": 

                break;
                case "768":
                case "640":
                case "480":
                case "320":

                break;
            }
        },

        "DynamicStyles": function() {
        	//Variables
            var regionDBackgroundSrc = $.trim('/cms/lib/AK01901510/Centricity/Template/GlobalAssets/images///Faces/default-man.jpg');
            var srcCheck = regionDBackgroundSrc.indexOf("Faces/default-man.jpg") > -1;

            var styles = "";

            if((regionDBackgroundSrc != "") && (!srcCheck)) {
                styles += '.hp-row.two:before { \n'+   
                              "\t background: url('"+regionDBackgroundSrc+"') no-repeat fixed; \n"+
                              "\t background-size: cover; \n"+
                          '}\n';
            } else {
                styles += '.hp-row.two:before { \n'+   
                              "\t background: url('/cms/lib/AK01901510/Centricity/Template/18/hp-region-d-background.jpg') top center no-repeat;\n"+
                              "\t background-size: cover; \n"+
                          '}\n';
            }

            styles +='.sw-mystart-button, .cs-mystart-item, .cs-mystart-dropdown { \n'+   
                        "\t border-left: 1px solid rgba("+this.HexToRgb('#ffffff')+", 0.4);\n"+
                    '}\n'+
                    '#gb-mystart-right > div:last-child { \n'+   
                        "\t border-right: 1px solid rgba("+this.HexToRgb('#ffffff')+", 0.4);\n"+
                    '}\n'+
                    '.gb-school-list-column ul li a { \n'+   
                        "\t border-bottom: 1px solid rgba("+this.HexToRgb('#ffffff')+", 0.25);\n"+
                    '}\n'+
                    'a.more-link, .ui-return, .view-calendar-link { \n'+   
                        "\t border: 1px solid rgba("+this.HexToRgb('#006B2B')+", 0.3);\n"+
                    '}\n'+
                    '#hp-slideshow .mmg-description-title, #hp-slideshow .mmg-description-caption { \n'+   
                        "\t background: rgba("+this.HexToRgb('#12435B')+", 0.85);\n"+
                    '}\n'+
                    '.hp-row.four .headlines .ui-article-info { \n'+ 
                        "\t background: rgba("+this.HexToRgb('#12435B')+", 0.8);\n"+  

                    '}\n'+
                    '.hp-row.four .headlines div.ui-article:after { \n'+   
                        "\t background: rgba("+this.HexToRgb('#000000')+", 0.7);\n"+
                    '}\n'+
                    '@media (max-width: 1399px) { \n'+
                        '#gb-mystart-left { \n'+ 
                        	"\t border-bottom: 1px solid rgba("+this.HexToRgb('#ffffff')+", 0.4);\n"+
                        '}\n'+
                    '}\n'+
                     '@media (max-width: 1023px) { \n'+
                        '.sp #sw-mystart-mypasskey { \n'+   
                            "\t border-right: 1px solid rgba("+this.HexToRgb('#ffffff')+", 0.4);\n"+
                        '}\n'+
                    '}\n';

            $('head').append(
                $('', {
                    id: 'cs-dynamic-background-styles',
                    html: styles
                })
            );

